// Gallery.js
import React from 'react';

function Gallery() {
  // Ganti dengan gambar-gambar kenanganmu
  const images = [
    '/assets/images/kenangan1.jpg',
    '/assets/images/kenangan2.jpg',
    '/assets/images/kenangan3.jpg',
  ];
  return (
    <section style={{margin: '2rem 0'}}>
      <h2>Galeri Kenangan</h2>
      <div style={{display: 'flex', gap: 16, flexWrap: 'wrap'}}>
        {images.map((src, i) => (
          <img key={i} src={src} alt={`Kenangan ${i+1}`} style={{width: 120, height: 120, objectFit: 'cover', borderRadius: 8, background: '#333'}} />
        ))}
      </div>
    </section>
  );
}

export default Gallery;
